import { experience } from "../Data/data";
// import { ExperienceModel } from "../Data/types";

const Experience = () => {
    return (
        <>
        {experience.map(item => (
            <div className="mb-12" style={{color: "#888D91"}} key={item.id}>
                <p className="font-medium" style={{color: "#98FBFC"}}>{item.role} - <span style={{color: "#158CE1"}}>{item.company}</span></p>
                <p className="text-sm" style={{color: "#235588"}}>{item.duration}</p>
                <p>{item.description}</p>
                <p className="text-xs flex space-x-4">{item.techStack.map((tech => (
                    <p className="px-2 py-1" style={{backgroundColor: "#3D5684", color: "#98FBFC"}}>{tech}</p>
                    )))}
                </p>
            </div>
        ))}
        </>
    )
}

export default Experience;
